import React, { Component } from 'react';
import { Spring } from 'react-spring'
class Animation extends Component {
    state = {  }
    render() { 
        return ( 
            <Spring
            from={{opacity:0,marginTop:-500}}
            to={{opacity:1,marginTop:0}}
            >
                {props =>(
                    <div style={props}>
                        <div className='container'>
                            <div style={{width:'100px',wordBreak:'break-all',padding:'10px',backgroundColor:'lavender',borderRadius:'10px'}}> Lorem ipsum dolor sit amet consectetur adipisicing elit. Voluptatum reprehenderit labore quaerat minus consectetur, optio fugiat dolore, amet ipsam quos libero? Maxime autem veritatis praesentium mollitia! Repudiandae voluptates omnis vitae! </div>
                        </div> 
                    </div>
                )}
            </Spring>
        );
    }
}
 
export default Animation;
